        })
        .catch((error) => {
            console.log(error);
        })
    }



    deleteExercise(id) {
        axios.delete('http://localhost:5001/about/'+id)
          .then(response => { console.log(response.data)});

        this.setState({
          exercises: this.state.exercises.filter(el => el._id !== id)
        })
